import React, { useEffect } from "react";
import { render, screen, act, waitFor } from "@testing-library/react";
import axios from "axios";
import "@testing-library/jest-dom";
import CartPage from "../../pages/CartPage";
import { SearchProvider } from "../../context/search";
import { CartProvider } from "../../context/cart";
import Orders from "../../pages/user/Orders";
import { AuthProvider } from "../../context/auth";
import { apiConfig, testApi } from "./testConfig";
import { BrowserRouter, MemoryRouter, Route, Routes } from "react-router-dom";
import DropIn from "braintree-web-drop-in-react";

// Mock toast
jest.mock("react-hot-toast", () => ({
  success: jest.fn(),
  error: jest.fn(),
}));

// In your test setup or a mock file
jest.mock("react-hot-toast", () => ({
  Toaster: () => <div data-testid="mock-toaster">Mock Toaster</div>,
  toast: jest.fn(),
}));

const renderCartPage = async () => {
  await act(async () => {
    render(
      <AuthProvider>
        <SearchProvider>
          <CartProvider>
            <MemoryRouter initialEntries={["/cart"]}>
              <Routes>
                <Route path="/cart" element={<CartPage />} />
                <Route path="/dashboard/user/orders" element={<Orders />} />
              </Routes>
            </MemoryRouter>
          </CartProvider>
        </SearchProvider>
      </AuthProvider>
    );
  });
};

describe("Cart Page Integration Tests", () => {
  let authToken = null;
  let braintreeToken = null;
  const product = {
    _id: {
      $oid: "67df7d78606a143f0519a170",
    },
    name: "Truffle Yakiniku Donburi",
    slug: "Truffle-Yakiniku-Donburi",
    description:
      "Pan-seared US black angus short rib, onsen egg, truffle soy sauce over Tanuki Rawâ€™s signature mixed rice",
    price: 22.3,
    category: {
      $oid: "67df789b606a143f0519a0a7",
    },
    quantity: 34,
    photo: {
      data: {
        $binary: {
          base64:
            "",
          subType: "00",
        },
      },
      contentType: "image/jpeg",
    },
    shipping: true,
    createdAt: {
      $date: "2025-03-23T03:18:16.429Z",
    },
    updatedAt: {
      $date: "2025-03-23T03:18:16.429Z",
    },
    __v: 0,
  };

  beforeEach(() => {
    jest.clearAllMocks();
    axios.defaults.baseURL = apiConfig.baseURL;
    axios.defaults.timeout = apiConfig.timeout;
  });

  beforeAll(async () => {
    try {
      console.log("Testing connection to:", axios.defaults.baseURL);

      const loginResponse = await testApi.post("/api/v1/auth/login", {
        email: "green@gmail.com",
        password: "123456",
      });
      console.log("API Response:", {
        status: loginResponse?.status,
        data: loginResponse?.data,
      });
      authToken = loginResponse?.data?.token;

      expect(loginResponse).toBeDefined();
      expect(loginResponse.status).toBeDefined();
    } catch (err) {
      console.log("Detailed error:", {
        name: err.name,
        message: err.message,
        stack: err.stack,
        axiosError: err.isAxiosError,
        response: err.response,
        request: err.request,
      });
      throw err;
    }
    console.log(authToken);

    try {
      const braintreeResponse = await testApi.get(
        "/api/v1/product/braintree/token"
      );
      console.log("Braintree Response:", braintreeResponse?.data.clientToken);
      braintreeToken = braintreeResponse?.data.clientToken;

      expect(braintreeResponse).toBeDefined();
      expect(braintreeResponse.status).toBeDefined();
    } catch (err) {
      console.log("Detailed error:", {
        name: err.name,
        message: err.message,
        stack: err.stack,
        axiosError: err.isAxiosError,
        response: err.response,
        request: err.request,
      });
      throw err;
    }
  });

  it("should render the Cart page with cart items", async () => {
    // add user and cart in local storage
    localStorage.setItem(
      "auth",
      JSON.stringify({
        token: authToken,
        user: {
          name: "green",
          email: "green@gmail.com",
          address: "house 123",
        },
      })
    );
    localStorage.setItem(
      `cartgreen@gmail.com`,
      JSON.stringify(["67df7d78606a143f0519a170"])
    );

    await renderCartPage();
    const loading = false;

    await waitFor(
      () => {
        expect(screen.queryByText("Loading...")).not.toBeInTheDocument();
      },
      { timeout: 100000 }
    );

    const checkItemsInCart = async () => {
      await waitFor(() => {
        expect(
          screen.getByText("Truffle Yakiniku Donburi")
        ).toBeInTheDocument();
        expect(screen.getByText("Hello green")).toBeInTheDocument();
        expect(
          screen.getByText("You Have 1 item in your cart")
        ).toBeInTheDocument();
        expect(screen.getByText("Total : $22.30")).toBeInTheDocument();
        // Use a more specific selector for the alert text
        const alertElement = screen.getByText(
          "PayPal payment option is unavailable."
        );
        expect(alertElement).toBeInTheDocument();
        //expect(screen.getByTestId("drop-in")).toBeInTheDocument();
      });
    };

    await checkItemsInCart();
    console.log(loading);
  });

  it("should not render the Cart page without authentication", async() => {
    localStorage.clear();
    localStorage.setItem(
      `cartgreen@gmail.com`,
      JSON.stringify(["67df7d78606a143f0519a170"])
    );

    await renderCartPage();

    await waitFor(() => {
      expect(screen.getByText("Hello Guest")).toBeInTheDocument();
      expect(screen.getByText("Please login to add to cart")).toBeInTheDocument();
    });

  })
});
